package katas;

import static org.hamcrest.CoreMatchers.is;
import static org.junit.Assert.assertThat;

import java.lang.reflect.Constructor;
import java.lang.reflect.InvocationTargetException;
import java.math.BigInteger;
import java.util.function.Function;
import java.util.stream.Collectors;
import java.util.stream.Stream;

import org.hamcrest.Matchers;
import org.junit.Assume;
import org.junit.Before;
import org.junit.Rule;
import org.junit.Test;
import org.junit.experimental.runners.Enclosed;
import org.junit.rules.ExpectedException;
import org.junit.runner.RunWith;
import org.junit.runners.Parameterized;

@RunWith(Enclosed.class)
public class FibTest {

    public static class StaticClass {
        @Rule
        public ExpectedException thrown = ExpectedException.none();

        @Test
        public void shouldNotCreate() throws IllegalAccessException, InstantiationException, NoSuchMethodException, InvocationTargetException {
            thrown.expect(InvocationTargetException.class);
            thrown.expectCause(Matchers.isA(UnsupportedOperationException.class));
            final Constructor c = Fib.class.getDeclaredConstructor();
            c.setAccessible(true);
            c.newInstance();
        }
    }

    public static class RecursiveTest extends SequenceTest {
        @Override
        protected Function<Integer, BigInteger> getImplementation() {
            return Fib.RECURSIVE;
        }

        @Override
        protected int getMaximumTestableIndex() {
            return 20;
        }
    }

    public static class IterativeTest extends SequenceTest {
        @Override
        protected Function<Integer, BigInteger> getImplementation() {
            return Fib.ITERATIVE;
        }
        @Override
        protected int getMaximumTestableIndex() {
            return 10_000;
        }
    }

    public static class FastDoublingWithWeakStoreTest extends SequenceTest {
        @Override
        protected Function<Integer, BigInteger> getImplementation() {
            return Fib.FAST_DOUBLING_WITH_WEAK_STORE;
        }
        @Override
        protected int getMaximumTestableIndex() {
            return Integer.MAX_VALUE;
        }
    }

    @RunWith(Parameterized.class)
    public static abstract class SequenceTest {
        @Parameterized.Parameters(name= "{index}: fib[{0}]={2}")
        public static Object[][] data() {
            return Stream.of(new Object[][] {
                { 0, "0" },
                { 1, "1" },
                { 2, "1" },
                { 3, "2" },
                { 4, "3" },
                { 5, "5" },
                { 6, "8" },
                { 7, "13" },
                { 8, "21" },
                { 9, "34" },
                { 10, "55" },
                { 11, "89" },
                { 20, "6765" },
                { 50, "12586269025" },
                { 99, "218922995834555169026" },
                { 1000, "43466557686937456435688527675040625802564660517371780402481729089536555417949051890403879840079255169295922593080322634775209689623239873322471161642996440906533187938298969649928516003704476137795166849228875" },
                { 10_000, "" },
                { 100_000, "" },
                { 1_000_000, Stream.of("",
                    "",
                    "",
                    "",
                    "",
                    "",
                    "",
                    "",
                    "",
                    "").collect(Collectors.joining()) },
            }).map(tableau->new Object[]{ tableau[0], tableau[1], truncateName((String)tableau[1]) })
                .toArray(Object[][]::new);
        }
        private static String truncateName(final String fullName) {
            if (fullName.length() > 10) {
                return fullName.substring(0, 10) + "...[" + (fullName.length() - 10) + "]";
            }
            return fullName;
        }

        @Parameterized.Parameter()
        public int index;
        @Parameterized.Parameter(1)
        public String expected;
        @Parameterized.Parameter(2)
        public String name;

        protected abstract Function<Integer, BigInteger> getImplementation();
        protected abstract int getMaximumTestableIndex();

        @Before
        public void before() {
            Assume.assumeThat(index, Matchers.lessThanOrEqualTo(getMaximumTestableIndex()));
        }

        @Test
        public void test() {
            assertThat(getImplementation().apply(index), is(new BigInteger(expected)));
        }

    }

}
